{"operationName":"VaultList","variables":{"ids":["0x7e4abd63a7c8314cc28d388303472353d884f292"]},"query":"query VaultList($ids: [ID!]!) {
  accounts(where: {id_in: $ids}) {
    id
    depositorSince
    ownerSince
    ownerships(first: 1000) {
      ...VaultListItem
      __typename
    }
    deposits(first: 1000) {
      id
      shares
      vault {
        ...VaultListItem
        __typename
      }
      __typename
    }
    assetManagements {
      ...VaultListItem
      __typename
    }
    __typename
  }
}

fragment VaultListItem on Vault {
  id
  name
  inception
  depositCount
  release {
    id
    __typename
  }
  comptroller {
    id
    denomination {
      ...Asset
      __typename
    }
    __typename
  }
  __typename
}

fragment Asset on Asset {
  id
  name
  symbol
  decimals
  __typename
}"}

